import React, { useState } from "react";
import { TextField } from '@material-ui/core';
import './Login.css'

export const Login = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const onSubmit = (e) => {
    e.preventDefault();

    if (!username) {
      alert("Please add a name");
      return;
    }

    if (!password) {
      alert("Please add a password");
      return;
    }

    setUsername("");
    setPassword("");
  };
  return (
    <div>
      <form className="add-form" onSubmit={onSubmit}>
        <div className="form-control">
          <TextField id="standard-basic" label="Username" type='text' value={username} onChange={(e) => setUsername(e.target.value)} />
        </div>
        <div className="form-control">
        <TextField id="standard-basic" label="Password" type='password' value={password} onChange={(e) => setPassword(e.target.value)} />
        </div>

        <input type="submit" value="login" className="btn btn-block" className='submit-btn' />
      </form>
    </div>
  );
};
